INSERT INTO `categorias_documentos` (`id_categoria`, `nombre`, `descripcion`) VALUES (1,'DEMANDA ART','					DEMANDA INDEMNIZACION POR INCAPACIDAD LABORAL\r\n                                INCONSTITUCIONALIDAD ARTS. LEY 24.557-\r\n\r\nSeÃ±or Juez:\r\nDr. CAMARDO MATÃAS, abogado, Mat. LÂº XLIV FÂº 227 del Colegio de Abogados 2da Circ. Rosario, con fianza legal vigente para el ejercicio de la profesiÃ³n,  constituyÃ©ndose  domicilio legal a todos los efectos en la calle Corrientes 715 PB Oficina 08 de la Ciudad de Rosario, Provincia de Santa Fe, ante V.S. me presento y respetuosamente digo:\r\n\r\nI.- PERSONERÃA:\r\nQue tal como lo acredito con el poder especial que acompaÃ±o, soy apoderado del Sr. ANDINO HORACIO MANUEL, con domicilio real en calle Garibaldi 264 bis de la ciudad de Rosario, provincia de Santa Fe, y cuyos demÃ¡s datos obran en el referido poder y que por motivos de brevedad doy aquÃ­ por reproducido.\r\n\r\nII.- OBJETO:\r\nSiguiendo expresas instrucciones de mi mandante, vengo por el presente a iniciar demanda tendiente al reclamo judicial por las prestaciones dinerarias y en especie contempladas en la Ley 26.773, derivada de las enfermedades laborales profesionales (LUXACION, ESGUINCE Y TORCEDURA DE ARTICULACIONES Y LIGAMENTOS DEL CODO - TRAUMATISMO DE HOMBRO, BRAZO Y ANTEBRAZO DERECHOS â€“ TRAUMATISMO EN EL QUINTO DEDO DE LA MANO DERECHA mÃ¡s las lesiones que surjan de la pericia mÃ©dica a realizarse), que se le ocasionÃ³ durante la relaciÃ³n laboral con la empresa GRIMOLDI S.A. CUIT 30-50078129-3, con domicilio en calle Florida 251 de la ciudad de Capital Federal, Provincia de Buenos Aires; entablando la demanda contra la empresa ASOCIART ART con domicilio en calle Av. Mendoza 1750, de la ciudad de Rosario Pcia. de Santa Fe, por la suma dineraria que quedara sujeta al porcentaje de incapacidad a determinarse por pericia mÃ©dica â€“ psicolÃ³gica y a lo que en mÃ¡s o en menos surja de las demÃ¡s pruebas a producirse en autos, mÃ¡s el 20% de pago Ãºnico â€“ en tanto de las pruebas periciales a realizarse o de agravamientos de cuadros clÃ­nicos psicofÃ­sicos impredecibles surja un monto superior â€“ que establece la nueva legislaciÃ³n (con su actualizaciÃ³n semestral), y lo que estime el sabio criterio del Tribunal y la jurisprudencia imperante al momento de dictar sentencia.  \r\nPara el supuesto de que en el futuro â€“y mientras dure la tramitaciÃ³n del presente juicio- se produzca desvaloraciÃ³n monetaria, dejo desde ya reclamado el importe correspondiente a dicha desvaloraciÃ³n, ajustable semestralmente por RIPTE (Remuneraciones Imponibles Promedio de los Trabajadores Estables), con el fin de mantener incÃ³lume el poder adquisitivo de la suma dineraria reclamada en autos. La presente demanda se instaura a los fines de que se declare el grado de incapacidad laboral que el actor posee como consecuencia de la relaciÃ³n antes descripta por su enfermedad profesional. A causa de ello postulamos se condene a la demandada ART a brindar a la actora la totalidad de las prestaciones dinerarias (indemnizaciÃ³n) y en especie que correspondan segÃºn legislaciÃ³n vigente\r\nAsimismo, y toda vez que la promociÃ³n de la presente acciÃ³n importa  desconocer los mecanismos previstos en la ley 24.557 en cuanto a la intervenciÃ³n de los Tribunales Federales para la determinaciÃ³n de la existencia del derecho que postulamos, solicitamos la declaraciÃ³n de inconstitucionalidad del art. 21 de la ley 24.557 y decreto 717/96 y concordantes en tanto violan los arts. 5, 14 bis, 18, 75 inc. 12, 108, 109, 121, 122 de la ConstituciÃ³n Nacional y art. 20 de la ConstituciÃ³n Provincial.\r\nTodo en virtud de los hechos, pruebas y derecho que se exponen a continuaciÃ³n. \r\n\r\nIII.- HECHOS:\r\nIII.I.- La relaciÃ³n laboral:\r\nEl actor Sr. Andino Horacio, ingresÃ³ a laborar como empleado para GRIMOLDI S.A. CUIT 30-50078129-3, con domicilio en calle Florida 251 de la ciudad de Capital Federal, Provincia de Buenos Aires, en una tÃ­pica relaciÃ³n de subordinaciÃ³n, dependencia y exclusividad.\r\nMi mandante realiza tareas calificadas acorde a su categorÃ­a de PERSONAL ESPECIALIZADO cobrando una remuneraciÃ³n mensual promedio relativo de $2.800.- (PESOS DOS MIL OCHOCIENTOS), importe que habremos de tomar como parÃ¡metro a los fines del futuro cÃ¡lculo de las prestaciones legales.\r\nMi poderdante se desempeÃ±a en la mencionada actividad desde hace  4 aÃ±os 1 mes y 21 dÃ­as segÃºn copias de recibos de sueldo que con la presente se adjuntan.\r\n\r\nIII.II.- El accidente de trabajo:\r\nAsÃ­ las cosas, pasarÃ© a relatar el accidente de trabajo sufrido por el Sr. Andino, por el cual hoy se viene a demandar lo que en su momento debieron otorgar sin necesidad de reclamo alguno la aquÃ­ demandada.\r\nEn fecha 16 de Septiembre de 2013 en circunstancias en que el actor se encontraba trabajando para la empresa GRIMOLDI S.A. CUIT 30-50078129-3, en instancias de haber estado cumpliendo con sus tareas habituales se encontraba en el deposito bajando unas cajas de gran porte; vale aclarar que la escalera estaba en precarias condiciones; a causa del peso de las cajas y la poca estabilidad de la escalera y por supuesto de la falta de Elementos de ProtecciÃ³n Personal; mi poderdante cae al piso sufriendo traumatismos.\r\nCon motivo del siniestro detallado, se dirige a su ART, ASOCIART, quien luego de realizarle ecografÃ­as y mÃ¡s de 15 sesiones de kinesiologÃ­a  le diagnosticÃ³ LUXACION, ESGUINCE Y TORCEDURA DE ARTICULACIONES Y LIGAMENTOS DEL CODO - TRAUMATISMO DE HOMBRO, BRAZO Y ANTEBRAZO DERECHOS â€“ TRAUMATISMO EN EL QUINTO DEDO DE LA MANO DERECHA.\r\nTras falsas promesas de sus mÃ©dicos, de que con el tiempo su brazo derecho volverÃ­a a tener la movilidad normal y aprovechando el desconocimiento, la necesidad y la falta de asesoramiento de mi poderdante, se otorga alta mÃ©dica en fecha 25 de Octubre de 2013; alta que por ello no tiene valor alguno y que a travÃ©s de pericial mÃ©dica a producirse en autos se demostrarÃ¡ que no debiÃ³ haberse otorgado, y que debiÃ³ haberse tratado oportunamente la rodilla accidentada.\r\nFinalmente, si bien retornÃ³ a sus tareas laborales por razones econÃ³micas, manifiesta fuertes dolores en su brazo derecho que le impiden el cumplimento normal de sus tareas habituales.\r\nAdemÃ¡s se determinarÃ¡ la incapacidad que hoy padece el Sr. Andino la cual nunca fue indemnizada.\r\nLa negligencia e irresponsabilidad de no atender el problema desde su inicio importaron que nunca mÃ¡s su brazo derecho vuelva a obtener su normal movilidad, y lo condicionen para el futuro, a la hora de intentar conseguir nuevos trabajos.\r\n\r\nIV.- ATRIBUCIÃ“N DE RESPONSABILIDAD DE LA DEMANDADA:\r\nEn virtud del accidente y su debida comunicaciÃ³n a ASOCIART ART, es inneÂ¬gable e irrebatible que el actor detenta daÃ±os fÃ­sicos y psicolÃ³gicos, que se determinarÃ¡n en forma definitiva por la pericia mÃ©dica y demÃ¡s prueba a producirse en autos.\r\nEl trabajador entrÃ³ a prestar servicios para GRIMOLDI S.A. CUIT 30-50078129-3 en perfecto estado de salud, y en la actualidad su condiciÃ³n fÃ­sica y psicolÃ³gica se encuentra gravemente deteriorada, a raÃ­z del siniestro relatado.\r\nPareciera ser que la aseguradora se comporta como tal a la hora de cobrar las primas, pero cuando el riesgo se materializa es la primera en desconocerlo, en vez de brindar su oportuna cobertura y honrar el contrato de afiliaciÃ³n.\r\nRecae sobre la demandada la responsabilidad objetiva derivada del tipo de tareas prestadas por el actor donde la repeticiÃ³n de las mismas implica tareas riesgosas y peligrosas por las que se daÃ±Ã³ el actor, lo que por sÃ­ solo habilita la reparaciÃ³n integral del perjuicio por este sufrido.-\r\nVale aclarar que la accionada violÃ³ claras disposiciones contenidas en la ley 19.587 y su decreto reglamentario 351/79, por ejemplo los arts. 1, 4, 5 (inc. k, o), art. 8 (inc. d) y art. 9 (inc. a, h, j, k, I) y sus concordantes entre otros, ya que la parte demandada ha incumplido con lo que dichos artÃ­culos estableÂ¬cen, violaciÃ³n que ha derivado en la incapacidad que el actor detenta actualÂ¬mente.-\r\n\r\nV.- DAÃ‘O PRODUCIDO:\r\nEl mismo se compone del daÃ±o emergente, o sea la incapacidad que detenta el actor derivada del  accidente ya detallado, incapacidad que serÃ¡ determinada en forma precisa por la pericial mÃ©dica a producirse en este juicio, teniendo siempre presente que dicha incapacidad es imputable al trabajo.-\r\na) Forma habitual de vida y su proyecciÃ³n sobre el afectado incapacitado: \r\nEl actor tenÃ­a una forma de vida normal, tanto desde el punto de vista econÃ³mico laboral, espiritual, intelecÂ¬tual, en las relaciones sociales, etc. que se resienten con motivo de la minusvalÃ­a derivada del trabajo, siendo factor importanÂ¬te a considerar el hecho que mi representado no trabaja mÃ¡s para la acÂ¬cionada y que se ve privado de la totalidad del ingreso mensual que antes tenÃ­a.-\r\n\r\nV.I.- Nexo Causal:\r\nAl referido nexo de causalidad se ha hecho alusiÃ³n en puntos anteriores y de todo lo narrado surge con claridad la existencia del mismo.-\r\n\r\nV.II.- Factor de AtribuciÃ³n:\r\nEn el presente caso funciona la responsabilidad objetiva derivada de la producciÃ³n del daÃ±o por cosas y/o actividades riesgoÂ¬sas y peligrosas, lo que de por sÃ­ solo habilita la procedencia de la reparaciÃ³n integral y el derecho por parte del actor de obtener la debida indemnizaciÃ³n.\r\n\r\nVI.- RUBROS RECLAMADOS:\r\nEl resarcimiento pecuniario aquÃ­ reclamado deberÃ¡ ser contemplativo de los siguientes rubros indemnizables, a saber:\r\nVI.I.- Prestaciones dinerarias \r\nEn virtud del desconocimiento de los derechos de mi mandante por parte de la demandada, y en funciÃ³n del grado de incapacidad que judicialmente se le determine al trabajador, corresponderÃ¡ el pago de las prestaciones dinerarias y en especie contempladas en la Ley 26.773, derivada de las enfermedades laborales profesionales ut supra mencionadas y a lo que en mÃ¡s o en menos surja de las demÃ¡s pruebas a producirse en autos, mÃ¡s el 20% de pago Ãºnico que establece la nueva legislaciÃ³n (con su actualizaciÃ³n semestral), y lo que estime el sabio criterio del Tribunal y la jurisprudencia imperante al momento de dictar sentencia, dejando desde ya reclamado el importe correspondiente a la desvaloraciÃ³n monetaria mientras dure el presente juicio, ajustable semestralmente por RIPTE (Remuneraciones Imponibles Promedio de los Trabajadores Estables), con el fin de mantener incÃ³lume el poder adquisitivo de la suma dineraria reclamada en autos.\r\n\r\nVI.II.- DaÃ±o moral:\r\nAparte del daÃ±o material ya reseÃ±ado, el actor ha sufrido un desequilibrio espiritual y emocional a consecuencia de su situaÂ¬ciÃ³n psico-fÃ­sica actual, originada en el accidente que sufriÃ³ mientras trabajaba bajo las Ã³rdenes de la demandada, siendo en este caso especÃ­fico, indiscutible la existencia y padecimiento de daÃ±o moral por nuestro mandante.\r\nDebemos tener en cuenta que daÃ±o moral son aquellos sufrimientos y padecimientos que la vÃ­ctima tiene que soportar por todos los inconvenientes, dolores, lesiones e incapacidades que se le ha ocasionado injustamente.\r\nLa determinaciÃ³n del quantum indemnizatorio de este rubro deÂ¬be estar dirigido a suministrar a la vÃ­ctima recursos aptos para menguar, en alguna medida, el detrimento psico- afectivo causado por el perjuicio.\r\nLas lesiones que afecten la integridad fÃ­sica de una persona pueden aparejar daÃ±os patrimoniales (los que ya han sido objeto de especÃ­fiÂ¬co debate), como tambiÃ©n daÃ±os morales, en cuantos sufrimientos fÃ­sicos y psÃ­quicos.- Los tribunales han declarado con generosidad:\r\n\"La existencia de incapacidad parcial y permanente y el grado de las lesiones sufridas, la duraciÃ³n del tratamiento con su secuela de dolores y molestias, no sÃ³lo han ocasionado el actor un padeciÂ¬miento fÃ­sico, con los consiguientes gastos y pÃ©rdidas, sino que tamÂ¬biÃ©n han causado un daÃ±o moral que debe ser reparado\"(CNEsp. civ. y Com., Sala VI, 10-5-77, Rep. E.D., 14-283, fallo 88).\r\nPor su misma naturaleza de extrapatrimonial, y por el hecho de estar configurado por sentimientos de angustias, aflicciones, sufrimientos y tormentos, es que EL DAÃ‘O NO NECESITA SER ACREDITADO ESPECÃFICA NI DETALLADAMENTE, tarea que a la postre devendrÃ­a en la mayoÂ¬rÃ­a de los casos en un imposible.\r\nLos tribunales rosarinos tienen sentada la siguiente premisa: \"El simple hecho de padecer algÃºn detrimento fÃ­sico origina en el portador de la incapacidad un agravio moral...\" (CÃ¡mara de ApelaciÃ³n Laboral de Rosario, Sala III, 28-8-96, \"Enrique, Santiago C/Pera Hnos. S/Cobro de Australes\"). \r\nEn el caso de marras, corresponde hacer lugar a la indemnizaÂ¬ciÃ³n pretendida por el daÃ±o moral padecido por nuestro mandante, en virtud de lo dispuesto por el art. 1078 del CÃ³digo Civil.-\r\nESTIMO EL MONTO INDEMNIZABLE POR DAÃ‘O MORAL PADECIDO POR EL ACTOR, EN LA SUMA DE PESOS TREINTA MIL ($30.000), O LO QUE EN MÃS O EN MENOS RESULTE DE LA PRUEBA A RENDIRSE EN AUTOS, DEL SABIO CRITEÂ¬RIO DEL TRIBUNAL Y DE LA JURISPRUDENCIA IMPERANTE AL MOÂ¬MENTO DE DICTAR SENTENCIA.-\r\n\r\nVII.- PLANTEA INCONSTITUCIONALIDAD DE LA LEY 24.557:\r\nb) Inconstitucionalidad del Art. 21 LRT.:\r\nResulta inconstitucional porque las atribuciones de las Comisiones MÃ©dicas especiales, violentan el art. 18 de la ConstituciÃ³n Nacional, sacÃ¡ndose al actor del juez natural de la causa, privÃ¡ndolo del debido proceso.-\r\nAkerman lo llama \"SustracciÃ³n de materias a la justicia ordinaria\" -\r\nLa Ley 24.577 ha instituido el llamado \"fuero personal\", por el carÃ¡cter tan solo de dependencia laboral, y ello en franca violaciÃ³n del art. 16 de la C.N. Resulta evidente que al derivar el reclamo indemnizatorio del dependiente a un organismo sin especialidad, ni competencia jurisdiccional, sin garantÃ­a del debido proceso legal en un juicio de conocimiento, estamos pues ante la franca violaciÃ³n de las normas constitucionales que imponen la obligaciÃ³n de no juzgar por \"comisiones especiales\" (art. 18 CN.), desco-nociendo por ende el acceso irrestricto a la justicia.-\r\nExiste otro argumento de peso, nos referimos a la \"Inconstitucionalidad por Irrazonabilidad\". En efecto, la Corte Suprema de Justicia de la NaciÃ³n ha admiÂ¬tido que el primer requisito que una ley debe cumplir es el de la razonabilidad, y que cabe la declaraciÃ³n de inconstitucionalidad de las normas arbitraÂ¬rias o irrazonables (\"CÃ­a. QuÃ­mica SA. c/ Municipalidad de TucumÃ¡n s/ Recurso contencioso administrativo y acciÃ³n de inconstitucionalidadâ€), y es a todas luces evidente que no cumple tal requisito el hecho de que un organismo administrativo integrado exclusivamente por mÃ©Â¬dicos pueda juzgar sobre hechos ajenos a sus incumbencias profesionales.-\r\nLos Dres. Ackerman y Maza, a travÃ©s de su obra \"LEY SOBRE RIESGOS DEL TRABAJO\" (\"Aspectos Constitucionales y ProcesaÂ¬les\", Ed. Rubinzal Culzoni, pÃ¡g. 194), dicen:\r\n\"Es inconcebible que las comisiones mÃ©dicas investiguen y juzguen si un hecho material se produjo o no..., pues su falta de formaciÃ³n tribunalicia y de entrenamiento forense no les permite... conocer las tÃ©cnicas de investigaciÃ³n de los hechos, la debida bÃºsqueda de la verdad material, la interrogaciÃ³n de testigos, la valoraciÃ³n... de los distintos elementos probatoÂ¬rios, ni la aplicaciÃ³n de los principios jurÃ­dico-procesales sobre ponderaciÃ³n de la prueba\".-\r\nPor ende, entiendo que bien podrÃ­a cuestionarse la constitucionalidad de esos casos de desvÃ­o de la jurisdicciÃ³n hacia el PEN. (ComiÂ¬siones mÃ©dicas especiales) por resultar irrazonable la norma.\r\nPero tambiÃ©n se cuestiona en atenciÃ³n a la invalidez de derivar a organisÂ¬mos especiales dependientes del Poder Ejecutivo Nacional el juzgamiento de hechos que corresponden al Poder Judicial.-\r\n \r\nc) Inconstitucionalidad Art. 32 y 46 L.R.T.:\r\nLa cuestiÃ³n se agrava cuando la L.R.T. pretende legislar sobre el procedimiento que, tal como surge del art. 121 C.N., le estÃ¡ expresamente vedado, ya que una ley que emanada del GobierÂ¬no Nacional no debe de manera alguna involucrar formas de aplicaciÃ³n que soslayen los procedimientos judiciales que se reservan las provincias.-\r\nEl art. 46 de la L.R.T. crea una nueva categoÂ¬rÃ­a judicial, otorgando a los juzgados federales \"COMPETENCIA APELATORIA\", deduciÃ©ndose que las Comisiones MÃ©dicas poseen el carÃ¡cter de Ã³rganos jurisdiccionales de primera instancia.-\r\nCabe preguntarse si la aplicaciÃ³n judicial de la L.R.T. corresponde a tribunales ordinarios o federales.-\r\nLa respuesta a tal interrogante la brindan los Dres. Ackerman y Maza en su libro ya citado, donde en pÃ¡g. 49, nos dicen: \"Los datos a ponderar para esta definiciÃ³n son:\r\n1.- La jurisdicciÃ³n federal es limitada y excepcional, surÂ¬ge de los artÃ­culos 116 y 117 de la ConstituciÃ³n Nacional, y se atriÂ¬buye en razÃ³n de la materia, de las personas o de los lugares;\r\n2.- Sea que se considere que la LR.T. es una ley laboral o de seguridad social, a partir de la regla del inciso 12 del artÃ­culo 75 de la CN, es claro que, en razÃ³n de la materia, se trata de Derecho comÃºn y no de Derecho federal;\r\n3.- Por la misma razÃ³n, y en cuanto supongan el incumplimienÂ¬to de obligaciones impuestas por la L.R.T. tampoco serÃ­an fedeÂ¬rales los delitos tipificados en funciÃ³n de tales incumpliÂ¬mientos;\r\n4.- Los sujetos involucrados en los conflictos sometidos a la jurisdicciÃ³n -trabajadores o derechohabientes, por un lado y compaÃ±Ã­as aseguradoras o empleados auto asegurados, por el otro, no son personas a las que se refiere el artÃ­culo 116 de la ConstituciÃ³nâ€. -\r\nâ€œserÃ­a, entonces, que la L.R.T. es Derecho comÃºn y, en consecuencia, el juez natural para su aplicaciÃ³n es el ordinario, local o provincial, y NO EL FEDERAL\".-\r\n\"Y esta atribuciÃ³n de competencia no deberÃ­a ser modifiÂ¬cada por una ley del Congreso\". -\r\nLa atribuciÃ³n de competencia a la justicia fedeÂ¬ral produce una violaciÃ³n directa y absoluta de los artÃ­culos 5, 75 inc. 12, 116 y 121 de la ConstituciÃ³n Nacional.-\r\nMucho mÃ¡s destacable es la jurisprudencia de la Corte Suprema de Justicia de la NaciÃ³n que en sentencia del 7-9-2004 dictada en autos: \"CASTILLO, ÃNGEL SANTOS., c/.CERÃMICA ALBERDI\", donde se reÂ¬suelve haciÃ©ndose lugar a la inconstitucionalidad del art. 46 de la L.R.T., re-mitiÃ©ndome al mismo y haciendo propios los argumentos de la Excma. Corte.-\r\nEn virtud de lo dicho en pÃ¡rrafos anteriores, solicito se deÂ¬clare la inconstitucionalidad de los artÃ­culos de la ley 24.557 citados.-\r\n\r\nVIII.- COMPETENCIA:\r\nV.S. es competente para entender en los presentes porque reÃºne todos los atributos que establece la legislaciÃ³n procesal y especial en materia de accidente y enfermedades laborales:\r\na) Competencia territorial: por ser V.S. el juez del lugar de celebraciÃ³n del contrato laboral del actor y lugar de trabajo (Rosario, departamento del mismo nombre Santa Fe).                                                          \r\nb) Competencia material y funcional: porque conforme a la doctrina judicial de autoridad emanada del fallo â€œCastillo c/ CerÃ¡mica Alberdiâ€, donde la CSJN declaro la inconstitucionalidad del art. 46 primer pÃ¡rrafo de la antigua LRT, fijo la competencia de los jueces provinciales con fuero laboral para conocer en las apelaciones presentadas contra dictÃ¡menes de las comisiones mÃ©dicas, como ahora la nueva legislaciÃ³n prevÃ© directamente la competencia en el fuero laboral.\r\n\r\nXI.- DERECHO:\r\nEn el articulado no cuestionado en su constitucionalidad de la Ley 26.773 y decretos reglamentarios junto a sus modificatorios, CN y CPL de la provincia de Santa Fe. \r\n\r\nXII.- PRUEBA:\r\nXII.I.- DOCUMENTAL:\r\n1.	Poder Especial. \r\n2.	Copia de Alta MÃ©dica de fecha 25/10/2013 otorgada por ASOCIART.\r\n3.	Copia de denuncia y solicitud de tratamiento a ASOCIART.\r\n4.	Copia de receta y tratamiento mÃ©dico de la Obra Social del Personal del Calzado Fdo. Por el Dr. Horacio Luis Monti Mat. 5521.\r\n5.	Copia de calendario de sesiones kinesiolÃ³gica del centro mÃ©dico de ASOCIART. \r\n6.	Copia del Recibo de Sueldo. \r\n\r\nXII.II.- DOCUMENTAL INTIMATIVA:\r\nSolicitamos las siguientes, a saber:\r\na)	Solicito se requiera a ASOCIART ART a que estaba afiliada GRIMOLDI S.A. CUIT 30-50078129-3, con domicilio en calle Florida 251 de la ciudad de Capital Federal, Provincia de Buenos Aires, para que remita a este Juzgado: contrato de afiliaciÃ³n, autodiagnÃ³stico, plan de mejoramiento de los condiciones de higieÂ¬ne y seguridad en el trabajo, inspecciones realizadas, sus resultados, denunÂ¬cias de accidentes de trabajo y enfermedades profesionales, denuncia de inÂ¬cumplimientos de normas de Higiene y Seguridad en el trabajo a la S.R.T.\r\nPara que en oportunidad de celebrarse la audiencia del art. 51 del CPL y bajo los apercibimiento de lo establecido en los art. 55 ss y cc del CPL y en los arts. 173 a 175 del CPCC, la ART presente toda la documental detallada a continuaciÃ³n, a saber: a.- Libro de accidentes y enfermedades profesionales (ley nacional 19.587 y decreto 1792/92 art. 3); b.- Examen mÃ©dico preocupacional del actor (art. 3 decreto 1792/92); c.- Constancia de haberle realizado al actor los exÃ¡menes mÃ©dicos periÃ³dicos que ordena la ley y sus resultados; d.- Constancia escrita de haberle comunicado al actor los resultados de los mismos; e.- Legajo MÃ©dico completo del actor y su carpeta mÃ©dica; f.- Constancia de haber dado cumplimiento al art. 3 resoluciÃ³n conjunta 25.178 de Superintendencia de Seguros de la NaciÃ³n y 31 (SRT) (BoletÃ­n Oficial 09/05/97) denuncia de las enfermedades profesionales (art. 32 y concordantes LRT); g.- Constancia de haber dado cumplimiento al art. 4 (PrevenciÃ³n de Riesgos del Trabajo) y sus decretos reglamentarios, en relaciÃ³n especÃ­fica al trabajo del actor: en especial acreditaciÃ³n del cump