idente relatado, y que por tanto disminuyÃ³ considerablemente su valor venal en relaciÃ³n a unidades similares, solicito se indemnice por la suma de PESOS MIL ($ 1.000,00).-\r\n\r\nIII.- IV.- PrivaciÃ³n de uso Laboral:\r\nA la hora de evaluar los daÃ±os sufridos en el vehÃ­culo de mi mandante debe tenerse presente que el rodado Pick - Up marca Ford F100 dominio UHL 874 se encuentra afectada al servicio de FLETE Ãºnico medio de subsistencia econÃ³mico para Ã©l y su familia, consecuencia del siniestro relatado el rodado no pudo ser utilizado por un periodo de diez (10) dÃ­as debido a que permaneciÃ³ en el taller a efecto de producir las reparaciones de mecÃ¡nica, chapearÃ­a y pintura.\r\nEn sÃ­ntesis, por el actuar negligente del conductor del vehÃ­culo por Uds. asegurado, el Sr. BenÃ­tez se vio privado de utilizar el rodado para laborar, conllevando esto no sÃ³lo a la pÃ©rdida efectiva de dinero, sino tambiÃ©n a no poder cumplir con su clientela recibir demandas o reclamos y/o una potencial y efectiva pÃ©rdida masiva de esta (lo cual la afectarÃ¡ durante todo el aÃ±o).\r\nTeniendo en cuenta que la recaudaciÃ³n diaria del flete es de un promedio aproximado de PESOS QUINIENTOS ($500.-) y mi poderdante se encontrÃ³ imposibilitado a causa del siniestro, por diez dÃ­as del uso del mismo, solicito se indemnice por la suma de PESOS CINCO MIL ($5.000.-).\r\n\r\nIII.- V.-  PrivaciÃ³n de Uso particular: \r\nDentro de este Ã­tem debe considerarse el perjuicio patrimonial que se le ocasiono al Sr. BenÃ­tez el hecho de verse privado del automotor a consecuencia del siniestro, atento al lapso que debiÃ³ permanecer en el taller mecÃ¡nico a los efectos de su reparaciÃ³n y teniendo en cuenta que el mismo es utilizado fuera de los horarios de trabajo como vehÃ­culo particular.- \r\nEs preciso citar al respecto la postura asumida por los Tribunales de la Provincia de Santa Fe, que clarifican sobre el punto de referencia: â€œâ€¦ Los daÃ±os por privaciÃ³n del uso del vehÃ­culo deben ser 