cial.\r\n2).- Se admita la prueba ofrecida.\r\n\r\n'),(9,'RECLAMO EXTRAJUDICIAL RESP. CIVIL','\r\n\r\nRECLAMO EXTRAJUDICIAL\r\n\r\n                                                                              Ref.: \r\n      Asdo.: Prado Centro Asturiano de Rosario\r\nPÃ³liza NÂº: 32139/0 \r\nSiniestro NÂº:_________________\r\n\r\n\r\nAL SR. GERENTE \r\nSEGUROMETAL\r\nS            /           D\r\n\r\n				Dr. CAMARDO MATIAS, abogado, Mat. LÂº XLIV FÂº 227 del Colegio de Abogados 2da Circ. de Rosario, informo que soy apoderado de la Sr. SCOLLO ABADIE ALEJANDRO DNI 21.414.742, quien actÃºa en representaciÃ³n de su hija menor de edad Srta. LIS SOFÃA DNI 44.630.895, ambos con domicilio real en calle Furlong 843 de la ciudad de Rosario, Pcia. de Santa Fe, constituyendo domicilio ad litem en calle Corrientes 715 PB. Oficina 08 de la ciudad de Rosario, Pcia de Santa Fe; cuyos demÃ¡s datos obran en el poder que en copia se adjunta, me presento respetuosamente a Ud. o por su intermedio a quien corresponda y digo:\r\n\r\nI.- OBJETO:\r\n				Que vengo por  este medio a interponer Reclamo Extrajudicial contra PRADO CENTRO ASTURIANO DE ROSARIO Y/O CONTRA QUIEN RESULTE JURÃDICAMENTE RESPONSABLE DEL ACCIDENTE QUE SUFRIERA MI PODERDANTE EN FECHA 18/11/2013 y, contra SEGURO METAL, en su carÃ¡cter de aseguradora del anterior, con domicilio en calle Alver 930 de la ciudad de Rosario, Pcia. de Santa Fe, por la suma de PESOS DOSCIENTOS CINCUENTA MIL.- ($250.000.-), con mÃ¡s honorarios, sus intereses legales, en mÃ©rito de las razones de hecho y de derecho que a continuaciÃ³n expongo.\r\nII.- HECHOS:\r\nEn fecha 18 de Noviembre de 2013 la Srta. Scollo Liz se encontraba en su clase habitual de PatÃ­n, la cual se lleva a cabo en el salÃ³n cubierto del Prado Centro Asturiano, mientras practicaba una â€œfiguraâ€ â€“ supervisada por su profesora â€“ que consistÃ­a en patinar hacia atrÃ¡s, repentinamente golpea contra un arco de hierro que por motivos que aÃºn se desconocen se hallaba al costado de la pista, lugar en que claramente no debÃ­a estar, ya que representa un peligro inminente teniendo en cuenta que las alumnas de patinaje tiene solo diez aÃ±os y estÃ¡n en pleno perÃ­odo de aprendizaje y son proclives a caerse o mÃ¡s aÃºn a desviarse involuntariamente de la pista.\r\nQue debido a la gravedad del daÃ±o sufrido, la Srta. Scollo debiÃ³ ser trasladada al Sanatorio de NiÃ±os; lugar donde le las primeras curaciones: sutura de cuatro puntos en el mentÃ³n e inmovilizaciÃ³n de la mandÃ­bula y brazo izquierdo a causa de una fractura en los mismos.\r\n\r\nIII.- RESPONSABILIDAD DEL ASEGURADO:\r\nEn cuanto a este punto es clara la responsabilidad de su asegurado, segÃºn lo establecido en el art. 1113 del CÃ³digo Civil y Comercial: â€œEn los supuestos de daÃ±os causados con las cosas, el dueÃ±o o guardiÃ¡n, para eximirse de responsabilidad, deberÃ¡ demostrar que de su parte no hubo culpa; pero si el daÃ±o hubiere sido causado por el riesgo o vicio de la cosa, sÃ³lo se eximirÃ¡ total o parcialmente de responsabilidad acreditando la culpa de la vÃ­ctima o de un tercero por quien no debe responderâ€¦â€. \r\nActualmente la normativa vigente tiende a una diferenciaciÃ³n directa entre los daÃ±os causados â€œcon las cosasâ€ de los generados â€œpor el riesgo o vicio de las cosasâ€ â€“ este Ãºltimo supuesto es al que se hace referencia en autos â€“ en los cuales las causales de exoneraciÃ³n son distintas. AsÃ­ para el caso de daÃ±os con las cosas alcanzarÃ¡ con probar la ausencia del elemento subjetivo â€œculpaâ€ para no ser responsable; mientras que en el supuesto de daÃ±os por riesgo o vicio de la cosa, atento la introducciÃ³n de un sistema de corte objetivo dentro del campo de la responsabilidad y de la aplicaciÃ³n de la â€œTeorÃ­a del riesgo creadoâ€ no bastarÃ¡ acreditar que no mediÃ³ culpa del responsable para liberarlo, sino que se deberÃ¡ romper el nexo causal. Es decir se prescinde del elemento subjetivo culpa, y es la mera causaciÃ³n del daÃ±o la que funda la responsabilidad dando lugar a una responsabilidad de tipo objetiva de la que sÃ³lo podrÃ¡ eximirse el dueÃ±o o guardiÃ¡n de la cosa demostrando culpa de la propia vÃ­ctima, hecho de un tercero por quien no se debe responder, la existencia de caso fortuito o fuerza mayor.\r\nSin embargo en el caso de autos en innegable existencia de responsabilidad por parte del asegurado, debido a que el hecho generador del accidente fue la negligencia de dejar al costado de la pista de patinaje - mientras alumnas de 10 aÃ±os tomaban su clase - un arco de hierro; que al tratarse de una cosa inerte no es causa del accidente si, inerte o en movimiento, ha ocupado su lugar comÃºn y ha funcionado normalmente; ello significa que las cosas inertes no son causa si no presentan alguna anomalÃ­a tanto en el lugar que ocupan como en su funcionamiento, como fehacientemente se ha probado a lo largo de este escrito, se puede dilucidar que el LUGAR NORMAL que debe ocupar un arco de hierro no es al costado de una pista de patinaje donde niÃ±as de 10 aÃ±os toman sus clases.\r\n\r\nIV.- DAÃ‘OS Y PERJUICIOS:\r\nIV.- I.- DaÃ±os FÃ­sicos:\r\nA raÃ­z del mencionado accidente la Srta. Scollo sufriÃ³ las siguientes lesiones â€“ segÃºn certificados y estudios mÃ©dicos que en copia se acompaÃ±an para ser agregado a autos â€“:\r\nâ€¢	Corte en el mentÃ³n con cuatro puntos de sutura.\r\nâ€¢	Fractura de radio izquierdo.\r\nâ€¢	Fractura de mandÃ­bula.\r\nHuelga aclarar que la Srta. Scollo tiene sÃ³lo diez aÃ±os y como consecuencia de la fractura en la mandÃ­bula la Srta. Scollo tuvo mÃ¡s de un mes imposibilitada de comer cosas sÃ³lidas, debiendo previamente procesar todos los alimentos y tomar bebidas Ãºnicamente con sorvete.\r\nSe acompaÃ±an al presente reclamo los estudios mÃ©dicos correspondientes que acreditan los daÃ±os denunciados.\r\nSobre este supuesto la CSJN en el fallo â€œDomÃ­nguez, Pedro RubÃ©n c/ Edenor y otros s/ accidente - acciÃ³n civilâ€, estableciÃ³ que: â€œâ€¦ La incapacidad debe ser objeto de reparaciÃ³n, al margen de lo que pueda corresponder por el daÃ±o moral, pues la integridad fÃ­sica en sÃ­ misma tiene un valor indemnizableâ€¦â€\r\n\r\nIV.- II.- DaÃ±o Moral: \r\nAparte del daÃ±o material ya reseÃ±ado, la vÃ­ctima ha sufrido un desequilibrio espiritual y emocional a consecuencia de su situaÂ¬ciÃ³n psico-fÃ­sica actual, originada en el accidente que sufriÃ³, siendo en este caso especÃ­fico, indiscutible la existencia y padecimiento de daÃ±o moral por nuestro mandante\r\nDebemos tener en cuenta que daÃ±o moral es aquel que se configura por  la perturbaciÃ³n profunda del equilibrio emocional de la vÃ­ctima, que guarde adecuado nexo causal con el hecho daÃ±oso y que entraÃ±e una significativa descompensaciÃ³n que altere su integraciÃ³n en el medio social\". TambiÃ©n se ha dicho que implica \"una perturbaciÃ³n patolÃ³gica de la personalidad, que altera el equilibrio bÃ¡sico o agrava algÃºn desequilibrio precedente del damnificado\".\r\nLa determinaciÃ³n del quantum indemnizatorio de este rubro deÂ¬be estar dirigido a suministrar a la vÃ­ctima recursos aptos para menguar, en alguna medida, el detrimento psico- afectivo causado por el perjuicio.\r\nLas lesiones que afecten la integridad fÃ­sica de una persona pueden aparejar daÃ±os patrimoniales (los que ya han sido objeto de especÃ­fiÂ¬co debate), como tambiÃ©n daÃ±os morales, en cuantos sufrimientos fÃ­sicos y psÃ­quicos.- Los tribunales han declarado con generosidad:\r\n\"La existencia de incapacidad parcial y permanente y el grado de las lesiones sufridas, la duraciÃ³n del tratamiento con su secuela de dolores y molestias, no sÃ³lo han ocasionado el actor un padeciÂ¬miento fÃ­sico, con los consiguientes gastos y pÃ©rdidas, sino que tamÂ¬biÃ©n han causado un daÃ±o moral que debe ser reparado\"(CNEsp. civ. y Com., Sala VI, 10-5-77, Rep. E.D., 14-283, fallo 88).\r\nAsimismo Los tribunales rosarinos tienen sentada la siguiente premisa: \"El simple hecho de padecer algÃºn detrimento fÃ­sico origina en el portador de la incapacidad un agravio moral...\" (CÃ¡mara de ApelaciÃ³n Laboral de Rosario, Sala III, 28-8-96, \"Enrique, Santiago C/Pera Hnos. S/Cobro de Australes\"). \r\nEn el caso de autos no se puede negar la existencia del desequilibrio emocional de la vÃ­ctima a causa del siniestro, recordemos que se trata de una niÃ±a de tan sÃ³lo 10 aÃ±os que se encuentra en plena formaciÃ³n de su vida, y se encontrÃ³ repentinamente con fracturas mÃºltiples (mandÃ­bula y radio izquierdo), con una cicatriz en el mentÃ³n, no pudiendo por mÃ¡s de UN MES comer alimentos sÃ³lidos bebiendo Ãºnicamente con sorvete y mÃ¡s aÃºn modificar sustancialmente su estilo  y forma de vida, ya que con motivo de las lesiones sufridas no podÃ­a movilizarse provocÃ¡ndole un alejamiento significativo de su vida y entorno social.\r\nEs por eso que estimo el monto indemnizable de daÃ±o moral padecido por la vÃ­ctima en la suma de PESOS TREINTA MIL ($40.000)\r\n\r\nIV.- III.- DaÃ±o EstÃ©tico: \r\nEl daÃ±o estÃ©tico se define como, la materializaciÃ³n de un cambio de esta clase, muy especialmente cuando se expresa en la fisonomÃ­a, generando un comportamiento reactivo deprimente, esta definiciÃ³n se completa entendiendo que el perjuicio estÃ©tico es el \"conjunto de sufrimientos experimentados por la vÃ­ctima a continuaciÃ³n de una desgracia fÃ­sica\". El daÃ±o estÃ©tico vulnera el derecho constitucional a la integridad personal y prefigura la necesidad  de que sea indemnizado por el responsable.\r\nPara su apreciaciÃ³n pecuaria se han de manejar numerosos factores, sin embargo en la prÃ¡ctica por secuelas estÃ©ticas, la importancia de la suma abonada estÃ© en funciÃ³n del sexo, edad, estado civil, profesiÃ³n.\r\nVale aclarar que la Srta. Scollo tiene sÃ³lo diez aÃ±os, y sufriÃ³ un corte en el mentÃ³n por el cual le realizaron 4 puntos de sutura y una fractura en la mandÃ­bula, que ocasionaron un cambio evidente en la fisonomÃ­a de su cara originÃ¡ndole un cuadro de depresiÃ³n impactando negativamente en su desarrollo social.  \r\nV.-  LIQUIDACIÃ“N:\r\n\r\nDAÃ‘O FÃSICO.....................................................................$180.000.-\r\nDAÃ‘O MORAL.....................................................................$30.000.-\r\nDAÃ‘O ESTÃ‰TICOâ€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦..$40.000.-\r\nTOTAL...............................................................$250.000.- (PESOS DOSCIENTOS CINCUENTA MIL\r\n\r\nVI.- PRUEBA:\r\n\r\n1.	DOCUMENTAL\r\nâ€¢	Copia de Poder Especial.\r\nâ€¢	Copia de DNI de la Srta. Scollo.\r\nâ€¢	Certificados mÃ©dicos del Sanatorio de NiÃ±os Fdo. por el Dr. Roberto G. Blanco.\r\nâ€¢	Certificados mÃ©dicos del Sanatorio de NiÃ±os Fdo. Por la Dra. M. Luz Mac Carmack.\r\nâ€¢	Copia de TomografÃ­a computada de ambas articulaciones temporomandibulares del DiagnÃ³stico MÃ©dico OroÃ±o.\r\nâ€¢	Copia de OrtopantomografÃ­a digital del DiagnÃ³stico MÃ©dico OroÃ±o.\r\n\r\nVII.- PETITIO:\r\nPor las razones expuestas, solicito:\r\n1).- Se  haga lugar al presente reclamo extrajudicial.\r\n2).- Se determine fecha para una Junta MÃ©dica Privada a los fines de evaluar los daÃ±os fÃ­sicos, moral y estÃ©ticos reclamados.\r\n2).- Se admita la prueba ofrecida.\r\n'),(10,'SEGURO AUTOS/MOTO.','');
